import React, { Component } from 'react';
import { Switch, Route } from 'react-router-dom';
import LogIn from './components/logIn/LogIn';

class App extends Component {

  constructor(props) {
    super(props);
    this.state = {
      isLoggedIn: false,
    }
  }

  render() {
    return (
      <Switch>
        <Route exact path='/' render={(props) => LogIn} />
        <Route exact path='/feed' render={(props) => <div>feed</div>} />
      </Switch>
    )
  }
}

// create a login page with the form as component and replace <div>signup</div>

export default App;
